skip_varint_start_domain_request(<<1:1, _:7, Rest/binary>>, Z1, Z2, F, F@_1, F@_2, TrUserData) -> skip_varint_start_domain_request(Rest, Z1, Z2, F, F@_1, F@_2, TrUserData);
